export default function AddPost({ id, heading, description, likes_count, liked, comments }) {
    return (
        <div>
            {
                <form action="">
                    <input type="text" placeholder='Title' name='Title' />
                    <input type="text" placeholder='Title' name='Description' />
                    <input type="button" value="Add Post" />
                </form>
            }
        </div>
    )
}
